import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Landing from './components/Landing';
import HowItWorks from './components/landing-page/HowItWorks';
import SignUp from './login-page/SignUp';
import Login from './login-page/Login';
import EmailVerification from './login-page/EmailVerification';

import AgentUser from './components/AgentUser';
import FreeUser from './components/FreeUser';
import PremiumUser from './components/PremiumUser';
import SysAdmin from './components/SysAdmin';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/login" element={<Login />} />
        <Route path="/how-it-works" element={<HowItWorks />} />
        <Route path="/email-verification" element={<EmailVerification />} />

        {/* Dashboards */}
        <Route path="/dashboard/agent" element={<AgentUser />} />
        <Route path="/dashboard/free" element={<FreeUser />} />
        <Route path="/dashboard/premium" element={<PremiumUser />} />
        <Route path="/dashboard/sysadmin" element={<SysAdmin />} />
      </Routes>
    </Router>
  );
}

export default App;
